import styled from "styled-components";

export const Container = styled.div`
  width: 100vw;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 0;
  max-width: 100%;
`;
export const Logo = styled.div`
  width: 200px;
  height: 100px;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  background-image: url(${myImage});

`;
